import React from "react"

class TimeKeeper extends React.Component {
  componentDidMount() {
    console.log("hej")
  }
  componentDidUpdate() {
    setTimeout(function () {
      console.log("Hello")
    }, 1000)
  }
  render() {
    return <div>TimeKepper</div>
  }
}

export default TimeKeeper
